mapper.select:

select 

from NPSCUST
where NPSCUST_UNITNO = #{npscustUnitno,jdbcType=CHAR}
  and NPSCUST_PAYTYPE = #{npscustPaytype,jdbcType=CHAR}
  and NPSCUST_FEENO = #{npscustFeeno,jdbcType=CHAR}

mapper.delete:

delete from NPSCUST
where NPSCUST_UNITNO = #{npscustUnitno,jdbcType=CHAR}
  and NPSCUST_PAYTYPE = #{npscustPaytype,jdbcType=CHAR}
  and NPSCUST_FEENO = #{npscustFeeno,jdbcType=CHAR}
